import React from 'react';


import {
    Container
   } from 'reactstrap';

const SlideFourth  = () => {

  return (
    <div className="SlideFourth">

        <Container>
            <h1>Donec sit amet</h1>
            <h2>Curabitur lacinia luctus at justus.</h2>
        </Container>
    </div>
  );
}

export default SlideFourth ;
